// Example: Home.js
import React from 'react';

const Home = () => {
  return (
    <div className="p-4 bg-gray-100 dark:bg-gray-900 min-h-screen">
      <h1 className="text-3xl font-bold text-gray-800 dark:text-white mb-4">Welcome to My Portfolio</h1>
      <p className="text-lg text-gray-600 dark:text-gray-300">
        This is where I showcase my work and share my thoughts.
      </p>
    </div>
  );
};

export default Home;
